  response:
    body:
      string: '{"collection": "introducing-worldcoin", "name": "Introducing Worldcoin",
        "description": "Introducing Worldcoin\r\n\r\n\r\nMore than three years ago
        we founded Worldcoin with the ambition of creating a new identity and financial
        network owned by everyone; the rollout begins today. If successful, we believe
        Worldcoin could drastically increase economic opportunity,  scale a reliable
        solution for distinguishing humans from AI online while preserving privacy,
        enable global democratic processes, and eventually show a potential path to
        AI-funded UBI. \r\n\r\n\r\nWorldcoin consists of a privacy-preserving digital
        identity (World ID) and, where laws allow, a digital currency (WLD) received
        simply for being human.  We hope that, where the rules are less clear, such
        as in the U.S., steps will be taken so more people can benefit from both.\r\n\r\n\r\nYou
        can now download World App, the first protocol-compatible wallet, and reserve
        your share. After visiting  an Orb, a biometric verification device, you will
        receive a World ID. This lets you prove you are a real and unique person online
        while remaining completely private. As the global distribution of Orbs is
        ramping up, you can find the closest one and book time to be verified with
        World App and at worldcoin.org.\r\n\r\n\r\nWorldcoin is an attempt at global
        scale alignment, the journey will be challenging and the outcome is uncertain.
        But finding new ways to broadly share the coming  technological prosperity
        is a critical challenge of our time. We hope you\u2019ll join us. \r\n\r\n\r\nAlex
        Blania & Sam Altman", "image_url": "https://i.seadn.io/gcs/files/03e521e4cd13381f615df265f3c3a2a9.png?w=500&auto=format",
        "banner_image_url": "https://i.seadn.io/gcs/files/bcd3bb0965674c81d8ea0ced18a17b0a.jpg?w=500&auto=format",
        "owner": "0x43793e436e34903a379ff295a4fb0d7a23f93509", "safelist_status":
        "verified", "category": "", "is_disabled": false, "is_nsfw": false, "trait_offers_enabled":
